  <div>
    <p>Hello {props.name}</p>    </div>
)
}

const t = [1, -1, 3]

const App = () => { 

  const t = [1, 2, 3, 4, 5]

  const [first, second, ...rest] = t

  const Fiona = {
    name : 'ochieng',

    age : [21,22,23],
    school : {
      first : 'acacia',
      second : 'Ngiya',
      third : 'strathmore',
    }
  }

  const Value = 'name'
  Fiona.home = 'syo'
  console.log(Fiona[Value])  // 1, 2 is printed


  return (
    <div>
      <h1>Greetings</h1>
      <Hello />    </div>
  )
}

export default App
